import ReactPlayer from "react-player";
import "../styles/youtubePlayer.css"

function YoutubePlayer(){
    return (
        <div id="react-player">
            <ReactPlayer width="100%" height="100%" url="https://www.youtube.com/watch?v=8unt57KrZLI" controls={true} />
        </div>
        
    )
}

export default YoutubePlayer;
